import React from 'react';
import './Learning.css'

export function LearningForm() {
    return (
        <div className="board">
            <div className="main">
                <h1>나에게 맞는 문제를 <br></br>추천해드립니다</h1>
                <p>인공지능이 수백개의 문제를 분석하여
                    나에게 맞는 문제를 추천합니다.
                    개선사항에 대한 의견을 게시판에서 들려주세요.
                </p>
            </div>
            <div className="test">
                <button className="test-btn">진단평가</button>
                <p>아직 ONE PASS가 처음이시군요? 진단평가를 치뤄보세요.</p>
            </div>
        </div>
    );
};
